-- http://rosalind.info/problems/dna/				 
{- 
Given: A DNA string s of length at most 1000 nt.
Return: Four integers (separated by spaces) counting the respective number of times that the symbols 'A', 'C', 'G', and 'T' occur in s.

 Sample Dataset
 AGCTTTTCATTCTGACTGCAACGGGCAATATGTCTCTGTGTGGATTAAAAAAAGAGTGTCTGATAGCAGC
 Sample Output
 20 12 17 21
 numDNAstring "AGCTTTTCATTCTGACTGCAACGGGCAATATGTCTCTGTGTGGATTAAAAAAAGAGTGTCTGATAGCAGC"
 [20,12,17,21] 
-}

numStr :: Char->String->Integer->Integer
numStr ch [] i = i
numStr ch (el:str) i =  if(ch==el) 
						then numStr ch str (i+1)
						else numStr ch str i

numDNAstring :: String -> [Integer]
numDNAstring str =let
					a =numStr 'A' str 0
					c =numStr 'C' str 0
					g =numStr 'G' str 0
					t =numStr 'T' str 0
				  in [a, c, g, t]

