--Transcribing DNA into RNA http://rosalind.info/problems/rna/
{-
Given: A DNA string t having length at most 1000 nt.
Return: The transcribed RNA string of t.

Sample Dataset
GATGGAACTTGACTACGTAAATT
Sample Output
GAUGGAACUUGACUACGUAAAUU

convertDNAtoRNAstring "GATGGAACTTGACTACGTAAATT"
"GAUGGAACUUGACUACGUAAAUU"
-}
transcribingDNAtoRNAstring :: String -> String
transcribingDNAtoRNAstring str = let
							fun::Char->Char
							fun 'T' = 'U'
							fun x = x
						in map fun str

 
-- Reverse Complement Problem  http://rosalind.info/problems/1b/
{-
Given: A DNA string Pattern.
Return: Pattern, the reverse complement of Pattern.

Sample Dataset
AAAACCCGGT
Sample Output
ACCGGGTTTT

reverseDNAstring "AAAACCCGGT"
"ACCGGGTTTT"
-}
reverseDNAstring :: String -> String
reverseDNAstring str = let
						fun::Char->Char
						fun 'A' = 'T'
						fun 'C' = 'G'
						fun 'G' = 'C'
						fun 'T' = 'A'
					 in reverse (map fun str)

