prTrans :: String -> String -> String
prTrans [] res = res
prTrans (a:b:c:str) res = prTrans str (res ++ [proteinTable a b c])
prTrans str res = res

proteinTranslation :: String -> String
proteinTranslation  str = delete '*' (prTrans str [])
